import React, {useState, useEffect} from 'react';
import clsx from 'clsx';
import {makeStyles} from '@material-ui/core/styles';
// import uuid from "uuid";
// import dynamic from 'next/dynamic'
// const uuid=dynamic(import ('uuid'),{ssr:false})


const useStyles = makeStyles(theme => ({
    root: {},
    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));


interface InfoProps {
    className ?: string
    user: User
}

interface User {
    address: String
    avatar: String
    birthday: String
    email: String
    facebook: String
    first_name: String
    gender: String
    google_id: String
    id: String
    intro: String
    last_name: String
    phone: String
    mobile: String
    skype: String
    username: String
    viber: String
    website: String
    zalo: String
    created_at: String
    updated_at: String
}

const Info: React.FunctionComponent<InfoProps> = (props: InfoProps) => {
    const { className, ...rest } = props
    const classes = useStyles()
    console.log(">>>>>> user", props.user)
    return (
        <div {...rest} className={clsx(classes.root, className)}>
            <h1>Info</h1>
        </div>
    );
};


export default Info;
